import React, { Component } from 'react';
import ReactDOM from 'react-dom';
import Layout from '@components/layout';

export default class PageA extends Component {
    render() {
        return (
            <Layout>
                ccc
            </Layout>
        );
    }
}

const rootEL = document.getElementById('root');

ReactDOM.render(
    <PageA />,
    rootEL
);
